import React, { Component } from "react";
import {
  Container,
  Header,
  View,
  DeckSwiper,
  Card,
  CardItem,
  Thumbnail,
  Text,
  Left,
  Body,
  Icon,
  Button,
  NativeBaseProvider,
} from "native-base";
const cards = [
  {
    text: "Card One",
    name: "One",
  },
];
const QuizScreen = () => {
  return (
    <Container>
      <Header />
      <Content padder>
        <Card>
          <CardItem header bordered>
            <Text>NativeBase</Text>
          </CardItem>
          <CardItem bordered>
            <Body>
              <Text>
                NativeBase is a free and open source framework that enable
                developers to build high-quality mobile apps using React Native
                iOS and Android apps with a fusion of ES6.
              </Text>
            </Body>
          </CardItem>
          <CardItem footer bordered>
            <Text>GeekyAnts</Text>
          </CardItem>
        </Card>
      </Content>
    </Container>
  );
};
export default QuizScreen;
